import { Main } from "./styles"
import { useLocation } from "react-router-dom";

export default function Result(){
    const location = useLocation()
    const { formData, jobsData } = location.state;

    return(
        <Main>
            <h1>{ formData.jobname }</h1>

            <h2>Vagas</h2>
            {jobsData.map}
        </Main>
    )
}
